import React from 'react'
import ArrowUp from '../../resources/images/ArrowUpRight.svg'

export const Button = () => {
  return (
    <div className='button-get'>
        <p>Get in touch</p>
        <div>
            <img src={ArrowUp} alt="" />
        </div>
    </div>
  )
}
